      return '\n<div style="text-align=justify;">\n<h3>Position - 3 indicateurs</h3>\n<b>Aide g\xE9n\xE9rale</b>\n\nCe graphique en radar permet de comparer la situation d\u2019un territoire s\xE9lectionn\xE9 en fonction d\u2019un jeu de <b>3 indicateurs et plus</b>. Afin de rendre comparables les indicateurs exprim\xE9s dans des ordres de grandeur et des unit\xE9s de mesure h\xE9t\xE9rog\xE8nes, ceux-ci sont pr\xE9alablement normalis\xE9s au regard du rang des territoires sur chacun des indicateurs s\xE9lectionn\xE9s. Ainsi, pour un indicateur donn\xE9, une valeur d\u2019indice sera comprise entre 0 et 100. Par exemple, une valeur de 60 signifiera que 60 % des territoires sont caract\xE9ris\xE9es par des valeurs inf\xE9rieures sur cet indicateur et 40 % par des valeurs sup\xE9rieures.\nLe rang normalis\xE9 X\u2019 d\u2019un territoire i est calcul\xE9 en effectuant le rapport entre la valeur du rang absolu et le nombre total d\u2019observations multipli\xE9 par 100 :\n<p id="formula" style="text-align: center; font-size: 0.9em;">\n$Rang\\ Normalis\xE9\\ X\u2019 (Territoire\\ i) = {Rang\\ X\\ (Territoire\\ i) - 1 \\over {N - 1}} * 100$\n</p>\n<small>\nAvec :\nX : Indicateur X\nRang : position d\xE9croissante dans la distribution (croissant lorsque l\u2019indicateur est invers\xE9)\nN : Nombre total de territoires de l\u2019espace d\u2019\xE9tude\n</small>\nCette m\xE9thode permet de rendre comparables les positions relatives des territoires sur diff\xE9rents indicateurs en termes de rangs, mais elle ne restitue pas d\u2019information sur l\u2019ampleur des \xE9carts entre ces territoires.\nA partir de ces indices, on peut construire un graphique en radar qui correspond \xE0 un graphique multidimensionnel de rangs relatifs.\n</div>\n<br><p style="text-align: center;"><a class="buttonDownload" href="data/Doc_methodo_pos_3ind.pdf">Aide d\xE9taill\xE9e (.pdf)</a></p>';
