    key: 'getHelpMessage',
    value: function getHelpMessage() {
      return '\n<div style="text-align=justify;">\n<h3>Ressemblances</h3>\n<b>Aide g\xE9n\xE9rale</b>\n\nLes graphiques de ressemblance permettent de visualiser pour un indicateur et plus les r\xE9gions les plus proches statistiquement d\u2019une r\xE9gion de r\xE9f\xE9rence.\n\nLa proximit\xE9 statistique est sensible \xE0 la m\xE9thode de mesure utilis\xE9e. Regioviz propose deux m\xE9thodes classiques et facilement interpr\xE9tables. La <b>distance euclidienne</b> (ou distance \xE0 vol d\u2019oiseau) prend en compte des donn\xE9es pr\xE9alablement standardis\xE9es. Si la valeur de l\u2019indice \xE9quivaut \xE0 0, la similarit\xE9 est totale entre ces deux unit\xE9s territoriales. Plus la valeur de la distance est \xE9lev\xE9e, moins la similarit\xE9 est importante. <b>L\u2019\xE9cart de rang moyen</b> \xE9value la distance, exprim\xE9e en rang, qui s\xE9pare deux unit\xE9s territoriales. La valeur de cet indice est th\xE9oriquement comprise entre 1 (\xE9cart de rang minimal) et le nombre d\u2019unit\xE9s territoriales que constitue l\u2019espace d\u2019\xE9tude \u2013 1 (\xE9cart de rang maximal).\n\nL\u2019interface Regioviz propose deux niveaux pour la visualisation de ces ressemblances : la <b>ressemblance globale</b> et la <b>ressemblance d\xE9taill\xE9e</b> indicateur par indicateur.\n\nL\u2019option de distance globale propose une visualisation synth\xE9tique de l\u2019\xE9loignement statistique existant entre \xAB ma r\xE9gion \xBB et les autres r\xE9gions de l\u2019espace d\u2019\xE9tude sur les <i>n</i> indicateurs s\xE9lectionn\xE9s. Ce module est compos\xE9 d\u2019un graphique en essaim (<i>beeswarm</i>) qui permet de visualiser graphiquement le degr\xE9 de ressemblance statistique existant entre ma r\xE9gion et les autres r\xE9gions de l\u2019espace d\u2019\xE9tude. La carte associ\xE9e \xE0 la repr\xE9sentation graphique rend compte de l\u2019organisation spatiale de ces proximit\xE9s statistiques : les 25 % des indices de similarit\xE9 les plus faibles (r\xE9gions les plus ressemblantes) apparaissent dans des tonalit\xE9s rouges, les 25 % les plus importantes (r\xE9gions les moins ressemblantes) sont repr\xE9sent\xE9es par des tonalit\xE9s bleues.\n\nPour comprendre quel est le poids de chaque indicateur dans la mesure de ressemblance globale, Regioviz propose syst\xE9matiquement une repr\xE9sentation graphique permettant d\u2019\xE9valuer visuellement le degr\xE9 de similarit\xE9 indicateur par indicateur (ressemblances par indicateur). Par d\xE9faut, l\u2019application d\xE9compose cette ressemblance pour l\u2019unit\xE9 territoriale qui ressemble le plus \xE0 \xAB mon territoire \xBB de r\xE9f\xE9rence d\u2019apr\xE8s la mesure globale de ressemblance. Libre ensuite \xE0 l\u2019utilisateur de choisir plus ou moins d\u2019unit\xE9s territoriales de comparaison (les <i>n</i> unit\xE9s les plus ressemblantes) en fonction de ses objectifs d\u2019analyse.\n</div>\n<br><p style="text-align: center;"><a class="buttonDownload" href="data/Doc_methodo_ressemblances.pdf">Aide d\xE9taill\xE9e (.pdf)</a></p>';
    }

