function getRandomStartingState() {
  var first_var_group = variables_info[0].group;
  // Variable codes from the first group of variables displayed:
  var var_first_group = variables_info.filter(function (d) {
    return d.group === first_var_group;
  }).map(function (d) {
    return d.id;
  });
  // Code of existing territorial mesh:
  var available_territ_mesh = territorial_mesh.map(function (d) {
    return d.id;
  });
  // Randomly chose a territorial mesh:
  var start_territorial_mesh = getRandom(available_territ_mesh);

  // Then we are picking a region from this territorial mesh:
  var start_region = getRandom(app.full_dataset.filter(function (d) {
    return d.REGIOVIZ === '1' && +d[start_territorial_mesh] === 1;
  }).map(function (d) {
    return d.id;
  }));

  var obj_my_region = app.full_dataset.find(function (d) {
    return d.id === start_region;
  });
  // Which are the variables from the first group also available for
  // this region:
  var available_var_first_group = [];
  var_first_group.forEach(function (v) {
    // eslint-disable-next-line no-restricted-globals
    if (!isNaN(+obj_my_region[v])) {
      available_var_first_group.push(v);
    }
  });
  // Randomly chose a variable among them:
  var start_variable = getRandom(available_var_first_group);
  return { start_territorial_mesh: start_territorial_mesh, start_region: start_region, start_variable: start_variable };
}

